[{"name": "mcp__chembl__search_chembl_molecule", "input": {"query": "FDA approved enzyme inhibitor", "limit": "20"}}, {"name": "mcp__pubmed__search_articles", "input": {"query": "FDA approved enzyme inhibitors protein targets", "max_results": 10}}, {"name": "mcp__pubmed__get_article_metadata", "input": {"pmids": ["41597198", "41559918", "41557625", "41518320", "41516368"]}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "imatinib", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "aspirin", "limit": 5}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "
PREFIX chembl: <http://rdf.ebi.ac.uk/terms/chembl#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?drug ?drugName ?target ?targetName ?targetType
WHERE {
  ?drug a chembl:SmallMolecule ;
        rdfs:label ?drugName ;
        chembl:hasActivity ?activity .

  ?activity chembl:hasAssay ?assay ;
            chembl:standardRelation "=" ;
            chembl:standardType "IC50" .

  ?assay chembl:hasTarget ?target .

  ?target rdfs:label ?targetName ;
          chembl:targetType ?targetType .

  FILTER(CONTAINS(LCASE(?targetType), "enzyme"))
  FILTER(CONTAINS(LCASE(?drugName), "inhibit") || 
         CONTAINS(LCASE(?drugName), "ib") ||
         REGEX(?drugName, "mab$", "i"))
}
LIMIT 50
"}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "kinase inhibitor FDA approved", "limit": 20}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "protease inhibitor HIV", "limit": 20}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "gefitinib", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "erlotinib", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "atorvastatin", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "lisinopril", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "ritonavir", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_target", "input": {"query": "EGFR epidermal growth factor receptor", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_target", "input": {"query": "HMG-CoA reductase", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_target", "input": {"query": "ACE angiotensin converting enzyme", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_target", "input": {"query": "HIV protease", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_target", "input": {"query": "BCR-ABL tyrosine kinase", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "methotrexate", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "sildenafil", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "omeprazole", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_target", "input": {"query": "dihydrofolate reductase", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_target", "input": {"query": "phosphodiesterase type 5", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_target", "input": {"query": "H+/K+ ATPase proton pump", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_target", "input": {"query": "COX-2 cyclooxygenase", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_target", "input": {"query": "PDE5 phosphodiesterase 5", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "celecoxib", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_target", "input": {"query": "JAK janus kinase", "limit": 5}}, {"name": "mcp__togomcp__search_chembl_target", "input": {"query": "topoisomerase", "limit": 5}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "nando"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dct: <http://purl.org/dc/terms/>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>
PREFIX nando: <http://nanbyodata.jp/ontology/NANDO_>

SELECT ?disease ?identifier ?prefLabel ?en_label ?notif_num
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
  ?disease a owl:Class ;
           dct:identifier ?identifier ;
           skos:prefLabel ?prefLabel ;
           nando:hasNotificationNumber ?notif_num .
  OPTIONAL {
    ?disease rdfs:label ?en_label .
    FILTER(LANG(?en_label) = "en")
  }
}
ORDER BY xsd:integer(?notif_num)
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX dct: <http://purl.org/dc/terms/>
PREFIX nando: <http://nanbyodata.jp/ontology/NANDO_>

SELECT (COUNT(DISTINCT ?disease) as ?total_count)
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
  ?disease a owl:Class ;
           nando:hasNotificationNumber ?notif_num .
}"}}]

[{"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "human kinase phosphotransferase", "limit": 20}}, {"name": "mcp__ols__searchClasses", "input": {"query": "phosphate transfer reaction", "pageSize": 20}}, {"name": "mcp__ols__searchClasses", "input": {"query": "phosphorylation biological process", "pageSize": 20}}, {"name": "mcp__ols__searchClasses", "input": {"query": "protein kinase activity", "ontologyId": "go", "pageSize": 10}}, {"name": "mcp__ols__fetch", "input": {"id": "go+http://purl.obolibrary.org/obo/GO_0006468"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>

SELECT DISTINCT ?goterm ?label
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:classifiedWith ?goterm .
  ?goterm rdfs:label ?label .
  FILTER(CONTAINS(LCASE(?label), "kinase") || CONTAINS(LCASE(?label), "phosphotransferase"))
  FILTER(STRSTARTS(STR(?goterm), "http://purl.obolibrary.org/obo/GO"))
}
LIMIT 50"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "ddbj"}}, {"name": "mcp__togomcp__get_sparql_endpoints", "input": {}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ddbj", "sparql_query": "PREFIX nuc: <http://ddbj.nig.ac.jp/ontologies/nucleotide/>
PREFIX sio: <http://semanticscience.org/resource/>

SELECT DISTINCT ?entry_id ?organism
FROM <http://rdfportal.org/dataset/ddbj>
WHERE {
  ?entry a nuc:Entry ;
         dcterms:identifier ?entry_id ;
         nuc:organism ?organism .
  ?organism bif:contains "'escherichia' AND 'coli'" option (score ?relevance) .
}
ORDER BY DESC(?relevance)
LIMIT 5"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "ddbj", "sparql_query": "PREFIX nuc: <http://ddbj.nig.ac.jp/ontologies/nucleotide/>
PREFIX dcterms: <http://purl.org/dc/terms/>

SELECT DISTINCT ?entry_id ?organism
FROM <http://rdfportal.org/dataset/ddbj>
WHERE {
  ?entry a nuc:Entry ;
         dcterms:identifier ?entry_id ;
         nuc:organism ?organism .
  FILTER(REGEX(?organism, "Escherichia coli", "i"))
}
LIMIT 5"}}, {"name": "mcp__togomcp__ncbi_esearch", "input": {"database": "gene", "query": "Escherichia coli[organism] AND complete genome[title]", "max_results": 10}}, {"name": "mcp__togomcp__ncbi_esearch", "input": {"database": "gene", "query": "Escherichia coli K-12[organism]", "max_results": 20}}, {"name": "mcp__togomcp__ncbi_esummary", "input": {"database": "gene", "ids": ["947170", "948466", "948217", "947777", "948511", "947071", "944897", "948270", "947867", "947634"]}}, {"name": "mcp__togomcp__ncbi_esearch", "input": {"database": "gene", "query": "Escherichia coli K-12[organism] AND protein_coding[gene type]", "max_results": 20}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "organism:"Escherichia coli K-12" AND reviewed:true", "limit": 10}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "Escherichia coli K12 recA", "limit": 5}}, {"name": "mcp__togomcp__ncbi_esummary", "input": {"database": "gene", "ids": ["944786", "947567", "944750", "948488", "947210", "948297", "948473", "945829", "945006", "944821"]}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>

SELECT ?protein ?proteinName ?geneName ?function
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:511145 ;
           up:recommendedName ?recName ;
           up:encodedBy ?gene .
  ?recName up:fullName ?proteinName .
  ?gene skos:prefLabel ?geneName .
  OPTIONAL { ?protein up:function/rdfs:comment ?function }
  FILTER(?geneName IN ("recA", "dnaA", "ftsZ", "rpoD", "dnaK", "lacZ"))
}
LIMIT 10"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT ?protein ?proteinName ?geneName ?sequence
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:511145 ;
           up:reviewed true ;
           up:recommendedName ?recName ;
           up:encodedBy ?gene ;
           up:sequence ?seq .
  ?recName up:fullName ?proteinName .
  ?gene skos:prefLabel ?geneName .
  ?seq rdf:value ?sequence .
  FILTER(?geneName IN ("recA", "dnaA", "ftsZ", "rpoD", "dnaK"))
}
LIMIT 5"}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "Escherichia coli K12 dnaA", "limit": 3}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "Escherichia coli K12 ftsZ", "limit": 3}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "Escherichia coli K12 lacZ", "limit": 3}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "clinvar"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>

SELECT (COUNT(DISTINCT ?variant) as ?count)
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?variant a cvo:VariationArchiveType ;
           cvo:classified_record ?classrec .
  ?classrec cvo:classifications/cvo:germline_classification/cvo:description ?significance .
  FILTER(CONTAINS(LCASE(?significance), "pathogenic"))
}"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>

SELECT ?significance (COUNT(?variant) as ?count)
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?variant a cvo:VariationArchiveType ;
           cvo:classified_record ?classrec .
  ?classrec cvo:classifications/cvo:germline_classification/cvo:description ?significance .
}
GROUP BY ?significance
ORDER BY DESC(?count)
LIMIT 20"}}]
